import React from "react";

import PictureCard from "./picture-card";

import "./picture-card.css";
import {
    photos
} from "./photos";
const ImageRenderer = () => (
    <div style="display: flex; flex-flow: row wrap;">
        {
            photos.map(photo => {
                return (
                    <PictureCard
                        margin={"2px"}
                        photo={photo}
                    />
                )
            })
        }
    </div>
);

export default ImageRenderer
